import BlogList from "./BlogList";
import Header from "./Header";
import Blog from "./Blog";
import { useRoutes } from "react-router-dom";

function App() {
  const routes = useRoutes([
    { path: "/", element: <BlogList /> },
    { path: "/blog", element: <Blog /> },
  ]);

  return (
    <div className="App">
      <Header />
      {routes}
    </div>
  );
}

export default App;
